import secret from '../config/secret';

export const API = {
  User: {
    login: `${secret.API_URL}/users/login`
  },
  Manager: {
    WorkSchedule: {
      getWorkSchedules: `${secret.API_URL}/work-schedules`,
      addWorkSchedule: `${secret.API_URL}/work-schedules?year={year}`
    }
  }
}
